import blsm from "./blsm.jpg";
import blsmtwo from "./blsmtwo.jpg";
import blsmthree from "./blsmthree.jpg";

const cardsList = [
  { title: "blossom tree n1", imgUrl: blsm },
  {
    title: "blossom tree n2",
    imgUrl: blsmtwo,
  },
  {
    title: "blossom tree n3",
    imgUrl: blsmthree,
  },
];
export default cardsList;
